import React from 'react';
import {BrowserRouter as Router, Switch, Route, Link} from "react-router-dom";
import ProjectCard from './ProjectCard';
import projectData from './projectData';
import ProjectDescription from './ProjectDescription';
function Projects(){
    const projects = projectData.map(proj => <ProjectCard key={proj.id} title={proj.title} image={proj.image}/>);

    return(
    <div class="row projectsContent">
        {projects}
        <Switch>
            <Route path="/projects/:projectID" exact component={ProjectDetail} />
        </Switch>
    </div>





    );


}

const ProjectDetail = ({match}) => {
    const detail = projectData.find((detail) => {
        return parseInt(match.params.projectID) === detail.id
    });

    {match.isExact && <>
        <h1>{detail.title}</h1>
        {detail.subdetails.map}
    </>}
};



export default Projects;
